/*!40000 ALTER TABLE `especialidades` DISABLE KEYS */;
INSERT INTO `especialidades` VALUES (1,'Medicina Dentria','Medicina dentria  a rea da sade humana que estuda e trata o sistema estomatogntico - compreende a face, pescoo e cavidade bucal, abrangendo ossos, musculatura mastigatria, articulaes, dentes e tecidos.\r\n\r\nO significado de sade oral,  a ausncia de doena estomatolgica, bem como a correcta funo, estabilidade e at mesmo esttica de todo o sistema estomatogntico.  hoje certo e sabido que a sade oral tem srias implicaes na sade humana, sendo as duas indissociveis.',30.00),(2,'Ginecologia','A ginecologia literalmente significa \"a cincia da mulher\", mas na medicina  a especialidade que trata de doenas do sistema reprodutor feminino, tero, vagina e ovrios.',30.00),(3,'Otorrino','A Otorrinolaringologia  considerada uma das mais completas especialidades mdicas do mundo, com caractersticas clnicas e cirrgicas. O seu campo de actuao envolve as doenas do ouvido, do nariz e seios paranasais, faringe ,laringe e cabea e pescoo.',30.00),(4,'Pediatria','A pediatria  a especialidade mdica dedicada  assistncia  criana e ao adolescente, nos seus diversos aspectos, sejam eles preventivos (Puericultura) ou curativos. (principalmente crianas).\r\n\r\nAspectos preventivos envolvem aes como aleitamento materno, imunizaes (vacinas), preveno de acidentes, alm do acompanhamento e das orientaes necessrias a um crescimento e desenvolvimento saudveis (puericultura).\r\n\r\nOs curativos correspondem aos diversos procedimentos e tratamentos das mais diversas patologias exclusivas ou no da criana e adolescente.',40.00),(5,'Dermatologia','Dermatologia  a especialidade mdica que se ocupa do diagnstico e tratamento clnico-cirrgico das doenas que acometem o maior rgo do corpo humano  a pele, tendo em mdia 2 metros quadrados de rea em um indivduo adulto.\r\n\r\nA especialidade engloba ainda as doenas que acometem os anexos cutneos: cabelos e unhas, bem como as mucosas (ex: boca e genitais). Outra denominao  a dermatovenerologia j que a especialidade tem importante actuao no contexto das doenas sexualmente transmissveis (doenas venreas).\r\n\r\nA Dermatologia actua em todos os processos fisopatolgicos que envolvem a pele: desde simples infeces, reaes auto-imunes e inflamatrias, e tumores. A hansenologia  outra importante rea de actuao da dermatologia. Por lidar com a pele, a dermatologia  a especialidade mdica mais indicada para actuao em cosmiatria.',40.00),(6,'Alergologia','Alergologia (ou Imunoalergologia)  a especialidade da Medicina que visa o diagnstico e o tratamento das doenas alrgicas, que so as respostas exageradas do sistema imunolgico a uma substncia estranha ao organismo, uma hipersensibilidade imunolgica a um estmulo externo especfico. Os portadores de alergias so chamados de atpicos ou mais popularmente de alrgicos.',40.00),(7,'Medicina Geral','Medicina Interna ou Clnica geral,  a especialidade mdica que trata de pacientes adultos, actuando principalmente em ambiente hospitalar. Inclui o estudo das doenas de adultos, no cirrgicas, no obsttricas e no ginecolgicas, sendo a especialidade mdica a partir da qual se diferenciaram todas as outras como Cardiologia e Pneumologia.',40.00),(9,'Acunpunctura','A Acupunctura  um ramo da Medicina Tradicional Chinesa e um mtodo de tratamento considerado complementar de acordo com a nova terminologia da OMS - Organizao Mundial da Sade.\r\n\r\nSob a orientao do Dr. Rui Chico, esta especialidade milenar consiste na aplicao de agulhas, em pontos definidos do corpo, chamados de \"Pontos de Acupunctura\" ou \"Acupontos\", para obter efeito teraputico em diversas condies.\r\n\r\nOs pontos e meridianos tambm podem ser estimulados por outros tipos de tcnicas. Na verdade, os pontos de Acupunctura podem ser estimulados por agulhas, dedos (acupresso), stiper (do ingls Stimulation and Permanency - Estimulao Permanente), ventosa ou pelo aquecimento promovido por moxa ou seja longo tempo de aplicao do fogo, um basto de artemsia em brasa, que  aproximado da pele para aquecer o ponto de acupuntura, ou o mtodo de estimulao por laser.',50.00),(10,'TuiNa','Tui-N ou Tuina so os nomes pelo qual  conhecida esta massagem teraputica chinesa.\r\nAs manipulaes so usadas para estimular os pontos ou outras partes da superfcie do corpo, para corrigir o desequilibrio fisiolgico do mesmo e alcanar efeitos curativos.  uma parte muito importante da MTC. Na China antiga, a terapia era classificada em: medicina interna e medicina externa; o Tuin est includo na primeira.\r\n\r\nO Tuina pode ser usado para tratar vrias disfunes, entre as quais leses dos tecidos moles, neurologia, os cinco rgos dos sentidos, pediatria, etc.  especialmente satisfatrio para pacientes infantis e idosos. No presente, entretanto, o Tuin chins est dividido em vrios ramos, tais como: adulto, infantil, ortopedia e traumatologia, cosmetologia, preveno da sade, reabilitao, medicina desportiva e assim por diante.\r\n\r\nO Tuina Adulto  tradicionalmente usado para tratar diversos problemas de sade, como: espondilopatia cervical, estiramento lombar, prolapso do disco intervertebral lombar, estiramento lombar agudo, artrite reumatide, hipertenso e sequelas da apoplexia.',50.00),(12,'Podologia','A Podologia  a disciplina que se dedica ao estudo dos ps do ponto de vista da sua anatomia e patologia. Est integrada noutras disciplinas, como a cirurgia, a ortopedia, a fisioterapia e a dermatologia entre outras.',35.00),(13,'Nutrio','A consulta de nutrio abrange inmeras reas de interveno, permitindo aplicar a dietoterapia em todas as patologias que exijam cuidados nutricionais e dietticos adaptados a cada situao especfica, contribuindo para a sade e bem-estar do indivduo.',45.00),(14,'Neurocirurgia','Neurocirurgia  a especialidade que se ocupa do tratamento de do e (como, doenas vasculares, degenerativas, traumas cranio-enceflicos e raqui-medulares passveis de abordagem. Recentemente, tambm passou a tratar da substituio de rgos sensoriais (olho e ouvido interno) disfuncionais por dispositivos artificiais.',55.00),(15,'Terapia da Fala','A Terapia da fala,  a cincia que tem como objecto de estudo a comunicao humana. No apenas os distrbios da linguagem so do seu interesse, como tambm o modo de comunicao sdio e eficaz.',35.00);
