INSERT INTO `vantagens` VALUES (1,'Mdicos e tcnicos com currculo profissional','No poderia existir qualidade de servios se no existissem as mais-valias profissionais das pessoas que fazem parte de toda esta equipa. Assim, a Clnica Mdica e Dentria do Vale do Tejo preocupou-se desde o seu incio em juntar um conjunto de mdicos e tcnicos com provas dadas, que garantem a qualidade e o bem estar daqueles que depositam a sua confiana.'),(2,'Escolha dos melhores equipamentos e materiais','Porque existe o rigor tcnico e humano na aplicao de qualquer servio prestado, a Pseudo Clnica procura para a segurana dos seus pacientes, os melhores materiais do mercado, garantindo assim a qualidade de todos os seus actos mdicos.'),(3,'Honestidade dos servios','A principal vantagem da empresa.'),(4,'Marcao rpida de consultas','Em qualquer lugar atravs de email, ou por telefone, poder marcar prviamente a sua consulta.'),(5,'Facilidades de pagamento','A Pseudo Clnica, desenvolveu solues de pagamento at 12 meses sem qualquer juro ou entrada, e tambm parcerias com as maiores entidades bancrias do pas no sentido de agelizar e oferecer um conjunto de vantagens exclusivas para os seus clientes.  \r\nContamos com excelentes condies para que possa concretizar o tratamento que tanto necessita, aliviando assim, de uma forma fcil o pagamento mensal dessa obrigao.');
